package ctci.leetcode;

import java.util.HashMap;
import java.util.Map;

public class MinimumWindowString {

    public String minWindow(String s, String t) {
        Map<Character, Integer> countMap = new HashMap<>();
        char str[] = s.toCharArray();
        int start = 0, end = 0;

        int resStart = 0, resEnd = 0;
        for (int i = 0; i < t.length(); i++) {
            char chT = t.charAt(i);
            if (countMap.containsKey(chT)) {
                countMap.put(chT, countMap.get(chT) + 1);
            } else {
                countMap.put(chT, 1);
            }
        }
        int min = Integer.MAX_VALUE, currentCount = 0;
        Map<Character, Integer> currentCountMap = new HashMap<>();

        while (end < s.length()) {
            if (countMap.get(str[end]) != null) {
                if (currentCountMap.containsKey(str[end]))
                    currentCountMap.put(str[end], currentCountMap.get(str[end]) + 1);
                else
                    currentCountMap.put(str[end], 1);
                //countMap.put(str[end], countMap.get(str[end]) - 1);
            }
            if (currentCountMap.get(str[end]) != null && currentCountMap.get(str[end]) == countMap.get(str[end]))
                currentCount++;

            while(start <= end && currentCount == countMap.size()){
                if(currentCount == countMap.size() && end - start + 1 < min){
                    resStart = start;
                    resEnd = end;
                    min = end - start + 1;
                }
                if(currentCountMap.containsKey(str[start])){
                    currentCountMap.put(str[start], currentCountMap.get(str[start]) - 1);
                    if(currentCountMap.get(str[start]) < countMap.get(str[start]))
                        currentCount--;
                }
                start++;

            }
            end++;
        }

        return resStart == resEnd ? "" : s.substring(resStart, resEnd+1);

    }

    public static void main(String[] args) {
        MinimumWindowString obj = new MinimumWindowString();
        System.out.println(obj.minWindow("",
                ""));
    }
}
